Update nested element on mongodb with condition<p>With the follow collection structure, how do i update a specific key on a object that is inside a list with a <code>if</code> condition?</p>

<p>"Update the key 'price' if the key 'origin' is not 'H' or 'G'"</p>

<pre><code>{
    "sku": "x",
    "prices": [
    {
        "id": "0",
        "price": 234.56,
        "origin": "H"
    },
    {
        "id": "1",
        "price": 345.67,
        "origin": "J"
    }
  ]
}
</code></pre>

<p>I've tried use <code>$cond</code> with <code>$set</code> but i got the error: <code>Unrecognized pipeline stage name: '$set'</code>, here is a example: </p>

<p><a href="https://mongoplayground.net/p/o1SAirsmRvf" rel="nofollow noreferrer">https://mongoplayground.net/p/o1SAirsmRvf</a></p>

<pre><code>db.collection.aggregate([
    {$match: {sku: 'x', 'prices.id': '1'}},
    {$set: {
        'prices.$.price': {
            $cond: [{
                $or: [
                    {$ne: ['prices.$.origin', 'H']},
                    {$ne: ['prices.$.origin', 'G']},
                ]
            }, 10, 20]
        }
    }}
])
</code></pre>

