   let startDateTime = endDateTime - 24 * 60 * 60 * 1000;

   query.endDateTime = {
             $or: [
                   null,
                   { $and: [{ $gte: startDateTime }, { $lte: endDateTime }] }
                  ]
    };
</code></pre>

<p>My query is returning registers before <code>24 hours ago</code>. How to solve it?</p>

