How to update a document in MongoDB without inserting duplicate entry?<p>I have these docs in my collection.</p>

<pre><code>{"_id": 1, "name": "Banana, "quantity": 3}
{"_id": 2, "name": "Apple, "quantity": 4}
{"_id": 3, "name": "Orange, "quantity": 5}
</code></pre>

<p>Now I need to edit the 2nd doc in the collection. </p>

<pre><code>var doc = {"_id": 2}
var updateQuery = {"_id": 2, "name": "Banana", "quantity": 4}
var dataModified = { $set: updateQuery };
</code></pre>

<p>and use the updateOne query,</p>

<pre><code>db.collection.updateOne(doc, dataModified) 
</code></pre>

<p>This works fine. But this will add the duplicate entry of "<strong>Banana</strong>" in the docs. Like this:</p>

<pre><code>{"_id": 1, "name": "Banana, "quantity": 3}
{"_id": 2, "name": "Banana, "quantity": 4}
{"_id": 3, "name": "Orange, "quantity": 5}
</code></pre>

<p>So is there anyway, I could find out/restrict the duplicate entry of <code>"name"</code> field while updating the document?</p>

